const ProductList = ({ products }) => {
  return (
    <ul className="product-grid">
      {products.map((product) => {
        return (
          <ProductCard
            key={product.id}
            image={product.images[0]}
            name={product.name}
            description={product.description}
            price={product.prices}
            priceId={product.prices[0].id}
          />
        );
      })}
    </ul>
  );
};
export default ProductList;
